import React from 'react';

// Component
import HomeCard from '../presentational/HomeCard';

export default () => {
  return (
    <div className='flex items-start justify-start flex-wrap w-full'>
      {data.experiences.map(() => {
        return (
          <div className='md:w-1/4 sm:w-1/3 w-1/2 pb-5'>
            <HomeCard />
          </div>
        );
      })}
    </div>
  );
};
